perty is monitored 24 hours a day by a security service (SBS), with camera surveillance and monitoring of common areas, underground parking, and more. The building itself houses a restaurant, a dental clinic, a client center of the Ministry of Interior of the Slovak Republic, as well as the headquarters of our real estate agency MGM. It is just a few minutes' walk from the main entrance of the building."
}

